import React from 'react';
import styles from '../../CSS/Navbar.module.css';
import {
  Navbar,
  Nav,
  Form,
  FormControl,
  Button,

} from 'react-bootstrap';

import { AiOutlineSearch } from 'react-icons/ai';

function navbar() {
  return (
    <Navbar fixed="top" bg="light" expand="lg" className={styles.NavBar}>
      <Navbar.Brand className={styles.Logo}>
        <a href="/" className={styles.Brand} style={{ fontSize: '35px' }}>
          u
          <span style={{ color: '#008dc8' }}>Connect </span>
        </a>
      </Navbar.Brand>


        <Form inline >

         <FormControl
           type="text"
           placeholder="Search"
           className={styles.Search}
         />
         <Button style={{height:'2.8rem'}}>
           <AiOutlineSearch />
         </Button>

     </Form>

      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav" className={styles.ShiftRight}>


        <Nav className="mr-auto">

        </Nav>

        <Button href="/signup" variant="outline-info">Login/Signup</Button>{' '}
      </Navbar.Collapse>
    </Navbar>
  );
}

export default navbar;
